import React from "react";
import { useHistory } from "react-router-dom";

export default function SalesOrderSubTabsHeader() {
    const history = useHistory();
    const handleSalesBookingChange = () => {
        history.push("/inventory/stock/sales-order/sales-booking-list")
    }
    const handleSalesOrderChange = () => {
        history.push("/inventory/stock/sales-order/sales-order-list")
    }
    return (
        <>
            {/* TODAY SALE ROW */}
            <div>  
                <div className="mt-5 collection-budget-tabs">
                    <ul class="nav nav-pills mb-3" id="pills-tab" role="tablist">
                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-sales-order-sub-booking-tab" data-toggle="pill" href="#pills-inventory-stock-sales-order-sub-booking" role="tab" aria-controls="pills-inventory-stock-sales-order-sub-booking" aria-selected="false" onClick={handleSalesBookingChange}>Sales Booking</a>
                        </li>
                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-sales-order-sub-order-tab" data-toggle="pill" href="#pills-inventory-stock-sales-order-sub-order" role="tab" aria-controls="pills-inventory-stock-sales-order-sub-order" aria-selected="false" onClick={handleSalesOrderChange}>Sales Order</a>
                        </li>
                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-sales-order-sub-picking-list-tab" data-toggle="pill" href="#pills-inventory-stock-sales-order-sub-picking-list" role="tab" aria-controls="pills-inventory-stock-sales-order-sub-picking-list" aria-selected="false">Picking List</a>
                        </li>
                        <li class="nav-item mr-5" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-sales-order-sub-delivery-challan-tab" data-toggle="pill" href="#pills-inventory-stock-sales-order-sub-delivery-challan" role="tab" aria-controls="pills-inventory-stock-sales-order-sub-delivery-challan" aria-selected="false">Delivery Challan</a>
                        </li>
                        <li class="nav-item" role="presentation">
                            <a class="nav-link" id="pills-inventory-stock-sales-order-sub-invoices-tab" data-toggle="pill" href="#pills-inventory-stock-sales-order-sub-invoices" role="tab" aria-controls="pills-inventory-stock-sales-order-sub-invoices" aria-selected="false">Invoices</a>
                        </li>
                    </ul>
                </div>
            </div>
        </>
    );
}
